2:8854:951.docs:
Advances the iterator and returns the next value.

Returns [`None`] when iteration is finished. Individual iterator
implementations may choose to resume iteration, and so calling `next()`
again may or may not eventually start returning [`Some(Item)`] again at some
point.

[`Some(Item)`]: Some

# Examples

Basic usage:

```
let a = [1, 2, 3];

let mut iter = a.iter();

// A call to next() returns the next value...
assert_eq!(Some(&1), iter.next());
assert_eq!(Some(&2), iter.next());
assert_eq!(Some(&3), iter.next());

// ... and then None once it's over.
assert_eq!(None, iter.next());

// More calls may or may not return `None`. Here, they always will.
assert_eq!(None, iter.next());
assert_eq!(None, iter.next());
```

0:1500:1868.docs:
Counterpart to `bits`, `bytes` transforms its bit stream input into a byte slice for the underlying
parser, allowing byte-slice parsers to work on bit streams.

A partial byte remaining in the input will be ignored and the given parser will start parsing
at the next full byte.

```
use nom::bits::{bits, bytes, streaming::take};
use nom::combinator::rest;
use nom::error::Error;
use nom::sequence::tuple;
use nom::IResult;

fn parse(input: &[u8]) -> IResult<&[u8], (u8, u8, &[u8])> {
  bits::<_, _, Error<(&[u8], usize)>, _, _>(tuple((
    take(4usize),
    take(8usize),
    bytes::<_, _, Error<&[u8]>, _, _>(rest)
  )))(input)
}

let input = &[0x12, 0x34, 0xff, 0xff];

assert_eq!(parse( input ), Ok(( &[][..], (0x01, 0x23, &[0xff, 0xff][..]) )));
```

2:23050:61456.docs:
Returns the maximum lane in the vector.

Returns values based on equality, so a vector containing both `0.` and `-0.` may
return either.

This function will not return `NaN` unless all lanes are `NaN`.

# Examples

```
# #![feature(portable_simd)]
# #[cfg(feature = "as_crate")] use core_simd::simd;
# #[cfg(not(feature = "as_crate"))] use core::simd;
# use simd::{f32x2, SimdFloat};
let v = f32x2::from_array([1., 2.]);
assert_eq!(v.reduce_max(), 2.);

// NaN values are skipped...
let v = f32x2::from_array([1., f32::NAN]);
assert_eq!(v.reduce_max(), 1.);

// ...unless all values are NaN
let v = f32x2::from_array([f32::NAN, f32::NAN]);
assert!(v.reduce_max().is_nan());
```

2:8979:5428.docs:
Applies function to the elements of iterator and returns
the first true result or the first error.

The return type of this method depends on the return type of the closure.
If you return `Result<bool, E>` from the closure, you'll get a `Result<Option<Self::Item>; E>`.
If you return `Option<bool>` from the closure, you'll get an `Option<Option<Self::Item>>`.

# Examples

```
#![feature(try_find)]

let a = ["1", "2", "lol", "NaN", "5"];

let is_my_num = |s: &str, search: i32| -> Result<bool, std::num::ParseIntError> {
    Ok(s.parse::<i32>()?  == search)
};

let result = a.iter().try_find(|&&s| is_my_num(s, 2));
assert_eq!(result, Ok(Some(&"2")));

let result = a.iter().try_find(|&&s| is_my_num(s, 5));
assert!(result.is_err());
```

This also supports other types which implement `Try`, not just `Result`.
```
#![feature(try_find)]

use std::num::NonZeroU32;
let a = [3, 5, 7, 4, 9, 0, 11];
let result = a.iter().try_find(|&&x| NonZeroU32::new(x).map(|y| y.is_power_of_two()));
assert_eq!(result, Some(Some(&4)));
let result = a.iter().take(3).try_find(|&&x| NonZeroU32::new(x).map(|y| y.is_power_of_two()));
assert_eq!(result, Some(None));
let result = a.iter().rev().try_find(|&&x| NonZeroU32::new(x).map(|y| y.is_power_of_two()));
assert_eq!(result, None);
```

