0:1097:2803.docs:
Applies a list of parsers in any order.

Permutation will succeed if all of the child parsers succeeded.
It takes as argument a tuple of parsers, and returns a
tuple of the parser results.

```rust
# use nom::{Err,error::{Error, ErrorKind}, Needed, IResult};
use nom::character::complete::{alpha1, digit1};
use nom::branch::permutation;
# fn main() {
fn parser(input: &str) -> IResult<&str, (&str, &str)> {
  permutation((alpha1, digit1))(input)
}

// permutation recognizes alphabetic characters then digit
assert_eq!(parser("abc123"), Ok(("", ("abc", "123"))));

// but also in inverse order
assert_eq!(parser("123abc"), Ok(("", ("abc", "123"))));

// it will fail if one of the parsers failed
assert_eq!(parser("abc;"), Err(Err::Error(Error::new(";", ErrorKind::Digit))));
# }
```

The parsers are applied greedily: if there are multiple unapplied parsers
that could parse the next slice of input, the first one is used.
```rust
# use nom::{Err, error::{Error, ErrorKind}, IResult};
use nom::branch::permutation;
use nom::character::complete::{anychar, char};

fn parser(input: &str) -> IResult<&str, (char, char)> {
  permutation((anychar, char('a')))(input)
}

// anychar parses 'b', then char('a') parses 'a'
assert_eq!(parser("ba"), Ok(("", ('b', 'a'))));

// anychar parses 'a', then char('a') fails on 'b',
// even though char('a') followed by anychar would succeed
assert_eq!(parser("ab"), Err(Err::Error(Error::new("b", ErrorKind::Char))));
```

2:8872:5407.docs:
Creates a new iterator which places an item generated by `separator`
between adjacent items of the original iterator.

The closure will be called exactly once each time an item is placed
between two adjacent items from the underlying iterator; specifically,
the closure is not called if the underlying iterator yields less than
two items and after the last item is yielded.

If the iterator's item implements [`Clone`], it may be easier to use
[`intersperse`].

# Examples

Basic usage:

```
#![feature(iter_intersperse)]

#[derive(PartialEq, Debug)]
struct NotClone(usize);

let v = [NotClone(0), NotClone(1), NotClone(2)];
let mut it = v.into_iter().intersperse_with(|| NotClone(99));

assert_eq!(it.next(), Some(NotClone(0)));  // The first element from `v`.
assert_eq!(it.next(), Some(NotClone(99))); // The separator.
assert_eq!(it.next(), Some(NotClone(1)));  // The next element from `v`.
assert_eq!(it.next(), Some(NotClone(99))); // The separator.
assert_eq!(it.next(), Some(NotClone(2)));  // The last element from `v`.
assert_eq!(it.next(), None);               // The iterator is finished.
```

`intersperse_with` can be used in situations where the separator needs
to be computed:
```
#![feature(iter_intersperse)]

let src = ["Hello", "to", "all", "people", "!!"].iter().copied();

// The closure mutably borrows its context to generate an item.
let mut happy_emojis = ["  ", "  "].iter().copied();
let separator = || happy_emojis.next().unwrap_or("  ");

let result = src.intersperse_with(separator).collect::<String>();
assert_eq!(result, "Hello  to  all  people  !!");
```
[`Clone`]: crate::clone::Clone
[`intersperse`]: Iterator::intersperse

2:13757:14610.docs:
An iterator over substrings of the given string slice, separated by a
pattern, restricted to returning at most `n` items.

If `n` substrings are returned, the last substring (the `n`th substring)
will contain the remainder of the string.

The [pattern] can be a `&str`, [`char`], a slice of [`char`]s, or a
function or closure that determines if a character matches.

[`char`]: prim@char
[pattern]: self::pattern

# Iterator behavior

The returned iterator will not be double ended, because it is
not efficient to support.

If the pattern allows a reverse search, the [`rsplitn`] method can be
used.

[`rsplitn`]: str::rsplitn

# Examples

Simple patterns:

```
let v: Vec<&str> = "Mary had a little lambda".splitn(3, ' ').collect();
assert_eq!(v, ["Mary", "had", "a little lambda"]);

let v: Vec<&str> = "lionXXtigerXleopard".splitn(3, "X").collect();
assert_eq!(v, ["lion", "", "tigerXleopard"]);

let v: Vec<&str> = "abcXdef".splitn(1, 'X').collect();
assert_eq!(v, ["abcXdef"]);

let v: Vec<&str> = "".splitn(1, 'X').collect();
assert_eq!(v, [""]);
```

A more complex pattern, using a closure:

```
let v: Vec<&str> = "abc1defXghi".splitn(2, |c| c == '1' || c == 'X').collect();
assert_eq!(v, ["abc", "defXghi"]);
```

